package corejava;

public class whiledemo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		// while loop from 1 to 10 
		int i = 0;
		while(i <= 10) {
			System.out.println(i);
			i++;
		}
		
		int j=20;
		do {
			System.out.println(j);
			j++;
		}while(j>30);
		// output : 20, do while runs 1 time only
		
		// E
	}

}
